    return (
        <Card width={'medium'} height={'small'} justify='center'>
            <CardHeader flex>
                <Box direction='row'>
                    <User color='brand' />{props.name}
                </Box>
            </CardHeader>
            <CardBody direction='row'>
                <Text>{props.phone}</Text>
                <Text>{props.phone}</Text>
            </CardBody>
        </Card>
    )
}
